import "./Slide.css";

 

export default function Slide(props) {
 

	const {name,image,count,id}=props.categories
	return (
		<>
			<div className="item">
				<div className="category-item">
				 
						<img
							className="img-fluid custom-slick-img"
							key={image.id}
							src={image.src}
							 alt={image.alt}
							  
					 />
						<h6 style={{fontWeight:'700'}}>
							 {name}
							  
						</h6>
						<span style={{fontWeight:'700', color:'#fcb800', fontSize:'12px',}}> {`Stock: ${count}`}</span>
				 
				</div>
			</div>
		</>
	);
}
